import React from "react";
import { Layout, Tabs } from "antd";
import Login from "../../../components/AdminComponents/Login";
import Register from "../../../components/AdminComponents/Register";
import Logo from "../../../assets/img/png/Logo2.png";
import "./SigIn.scss";

export default function SignIn() {
  const { Content } = Layout;
  const { TabPane } = Tabs;
  return (
    <Layout className="sign-in">
      <Content className="sign-in__content">
        <h1 className="sign-in__content-logo">
          <center><img src={Logo} alt=""/></center>
        </h1>
        <div className="sign-in__content-tabs">
          <Tabs type="card">
            <TabPane tab={<span>Iniciar sesi√≥n</span>} key="1">
              <Login />
            </TabPane>
            <TabPane tab={<span>Registro</span>} key="2">
              <Register />
            </TabPane>
          </Tabs>
        </div>
      </Content>
    </Layout>
  );
}
